                            <Link to="/">Newest</Link>
                        </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link onClick={makeApiCall} eventKey="link-1">
                            <Link to="/">Highest Rated</Link>
                        </Nav.Link>
                    </Nav.Item>


                    <NavDropdown title="Filter" id="basic-nav-dropdown">
                        <NavDropdown.Item href="#action/3.1">Type of media</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Genre</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.3">Rating</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                    </NavDropdown>
                </Nav>
                <Form inline>
                    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                    <Button variant="outline-success">Search</Button>
                </Form>
            </Navbar.Collapse>
        </Navbar>
